import React from 'react';
import 'App.css';

const Header = React.lazy(() => import('component/Header'));
const Footer = React.lazy(() => import('component/Footer'));
function App() {
  return (
    <div className="App">
      <Header/>
      <main className="App-body">

      </main>
      <Footer/>
      <Footer/>
    </div>
  );
}

export default App;
